import React, { useState } from 'react';
import TextField from '@mui/material/TextField';
import Button from '@mui/material/Button';
import Card from '@mui/material/Card';
import CardContent from '@mui/material/CardContent';

const UserForm = ({ onSubmit }) => {
  const [formData, setFormData] = useState({
    name: '',
    dob: '',
    email: '',
    contactNumber: '',
    about: '',
  });
  const [errors, setErrors] = useState({});
  const [submittedData, setSubmittedData] = useState(null);

  const validateForm = () => {
    let valid = true;
    const newErrors = {};

    if (!formData.name.match(/^[A-Za-z]+$/)) {
      newErrors.name = 'Name should contain alphabets only';
      valid = false;
    }

    if (formData.contactNumber.length !== 10 || !/^\d+$/.test(formData.contactNumber)) {
      newErrors.contactNumber = 'Contact should be 10 digits';
      valid = false;
    }

    if (!/^[\w-]+(\.[\w-]+)*@[\w-]+(\.[\w-]+)+$/.test(formData.email)) {
      newErrors.email = 'Invalid email';
      valid = false;
    }

    const today = new Date();
    const dob = new Date(formData.dob);
    if (dob > today) {
      newErrors.dob = 'Date of birth cannot be greater than today';
      valid = false;
    }

    setErrors(newErrors);
    return valid;
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (validateForm()) {
      onSubmit(formData);
      setSubmittedData(formData);
    }
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
    setErrors({ ...errors, [name]: '' }); // Clear error when user types
  };

  return (
    <div>
      <form onSubmit={handleSubmit}>
        <TextField
          label="Name"
          name="name"
          value={formData.name}
          onChange={handleChange}
          error={!!errors.name}
          helperText={errors.name}
          fullWidth
          required
        />
        <TextField
          label="Date of Birth"
          name="dob"
          type="date"
          value={formData.dob}
          onChange={handleChange}
          error={!!errors.dob}
          helperText={errors.dob}
          fullWidth
          required
        />
        <TextField
          label="Email Id"
          name="email"
          type="email"
          value={formData.email}
          onChange={handleChange}
          error={!!errors.email}
          helperText={errors.email}
          fullWidth
          required
        />
        <TextField
          label="Contact Number"
          name="contactNumber"
          value={formData.contactNumber}
          onChange={handleChange}
          error={!!errors.contactNumber}
          helperText={errors.contactNumber}
          fullWidth
          required
        />
        <TextField
          label="Tell me about yourself"
          name="about"
          multiline
          rows={4}
          value={formData.about}
          onChange={handleChange}
          fullWidth
        />
        <Button type="submit" variant="contained" color="primary">
          Submit
        </Button>
      </form>

      {submittedData && (
        <Card sx={{ mt: 2 }}>
          <CardContent>
            <h2>Submitted User Information:</h2>
            <p><strong>Name:</strong> {submittedData.name}</p>
            <p><strong>Date of Birth:</strong> {submittedData.dob}</p>
            <p><strong>Email Id:</strong> {submittedData.email}</p>
            <p><strong>Contact Number:</strong> {submittedData.contactNumber}</p>
            <p><strong>About:</strong> {submittedData.about}</p>
          </CardContent>
        </Card>
      )}
    </div>
  );
};

export default UserForm;
